    <div className="bg-white text-purple-700 p-8 text-center flex w-9/12">
      <h2 className="text-2xl mt-4">{skillsData.titles[0]}</h2>
      <div className="grid grid-cols-2 gap-4 w-1/2 mt-4">
  {skillsData.skills.map((skill) => (
